import React from 'react';

function PokeSelect(props) {
    const { pokeList, foundPokes, foundFunction } = props;
    return (
        <div>
            {pokeList.map((mon, index) => {
                if (foundPokes[index].found) return null;
                else return <button 
                                className='select-button' 
                                onClick={() => foundFunction(mon.id)}>{mon.name}
                            </button>
            })
            }
        </div>
    );
}

export default PokeSelect;
